import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

export default function NovoAdmin() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '', email: '', senha: '', nivelAcesso: 'admin', ativo: true
  });

  const handleChange = e => {
    const { name, value, type, checked } = e.target;
    setForm(f => ({ ...f, [name]: type === 'checkbox' ? checked : value }));
  };

  const handleSubmit = async e => {
    e.preventDefault();
    await api.post('/admins', form);
    navigate('/admins');
  };

  return (
    <div className="container my-4">
      <div className="p-4 border rounded shadow-sm bg-white">
        <div className="d-flex justify-content-between align-items-center mb-4">
          <h2>Novo Admin</h2>
          <div>
            <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
            <Link to="/admins" className="btn btn-dark">Ver Admins</Link>
          </div>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="mb-3"><label className="form-label">Nome</label>
            <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
          </div>
          <div className="mb-3"><label className="form-label">Email</label>
            <input name="email" type="email" className="form-control" value={form.email} onChange={handleChange} />
          </div>
          <div className="mb-3"><label className="form-label">Senha</label>
            <input name="senha" type="password" className="form-control" value={form.senha} onChange={handleChange} />
          </div>
          <div className="mb-3"><label className="form-label">Nível de Acesso</label>
            <select name="nivelAcesso" className="form-select" value={form.nivelAcesso} onChange={handleChange}>
              <option value="super">Super</option>
              <option value="admin">Admin</option>
              <option value="moderador">Moderador</option>
            </select>
          </div>
          <div className="form-check mb-3">
            <input type="checkbox" className="form-check-input" name="ativo" checked={form.ativo} onChange={handleChange} />
            <label className="form-check-label">Ativo</label>
          </div>
          <button type="submit" className="btn btn-primary">Cadastrar Admin</button>
        </form>
      </div>
    </div>
  );
}
